import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

const KansaiDogCafe: React.FC = () => {
  return (
    <Router>
        <Routes>
          <Route path="/dogcafe/kansai" element={<KansaiDogCafe />} />
        </Routes>
    </Router>
  );
};

export default KansaiDogCafe;
